import newData from "./StoredData/LoginData";
import Base from "./base";
import Login from "./Login/LoginPage";
const Main = () => {
    return(
        <>
        <h1>Main Page</h1>
        {<newData/> != null ? <Base/> : <Login/>}
        </>
    )

}

export default Main;
